import React,{Component} from 'react';

import './Brunch.css';

import photos from './Data/Data.js'
import Display from './Display.js'



class Brunch extends Component() {

  render(){
  const photo = photos;
  return (     
          <div>   
            <div className="Page-Header"><p>brunch</p></div>
            <div class="row">

                {photo.map((e,i) =>
                    <Display 
                    color={e.color}
                    photo={e.photo}
                    name={e.text}
                    key={i}
                    url={e.url}
                    />
                )}

            </div>
          </div>
  );
    }
}

export default Brunch;
